import groovy.json.JsonSlurper

// Parse the response JSON
def response = messageExchange.responseContent
def jsonSlurper = new JsonSlurper()
def jsonResponse = jsonSlurper.parseText(response)

// List to store extracted usernames
def usernames = []

// Extract usernames from each object
jsonResponse.each { user ->
    usernames.add(user.username)
}

log.info("Usernames extracted from the response: $usernames")

// Assert for 'mosalah'
assert usernames.contains('mosalah')
log.info("Assertion 1: Username 'mosalah' found in the response.")

// Assert for 'leomessi'
assert usernames.contains('leomessi')
log.info("Assertion 2: Username 'leomessi' found in the response.")

assert usernames.contains('alberteinstein')
assert usernames.contains('aboutrikamohammed')

